import '../App.css'

const ThirdScreen = () => {
    return (
        <div className="third-screen" style={{ backgroundImage:` linear-gradient(rgba(255,34,21,0.1),rgba(255,34,21,1)),url('/image')`}}>
            <div className="third-screen-bubble">
                <img src="/image/buble.png"/>   
            </div>
        </div>
    )
}

export default ThirdScreen
